pragma solidity >=0.4.22 <0.8.0;
 
contract SITApreferences2{
    mapping(bytes => uint[4]) userpreferences; // Mapping string (address + key) as you cant use struct or array as mapping keys

    constructor() public{}

    function setPreferences(uint spatial, uint identity, uint temporal, uint activity, string memory key) public returns(bool success){
      // Require statement here to ensure all dimensions are 0-4
      bytes memory keyBytes = abi.encodePacked(key);
      userpreferences[abi.encodePacked(msg.sender, keyBytes)] = [spatial,identity,temporal,activity];
      return(true); // Need to return upon success of setting, but need require statement
    }

    function getPreferences(string memory key) public returns(uint[4] memory preferencesList){
      bytes memory keyBytes = abi.encodePacked(key);
      return(userpreferences[abi.encodePacked(msg.sender, keyBytes)]);

    }


    // Helper functions to convert an address to an ASCII string, Solidity doesn't have an inbuilt conversion method
    // https://ethereum.stackexchange.com/questions/8346/convert-address-to-string
    function toAsciiString(address x) internal pure returns (string memory) {
    bytes memory s = new bytes(40);
    for (uint i = 0; i < 20; i++) {
        bytes1 b = bytes1(uint8(uint(uint160(x)) / (2**(8*(19 - i)))));
        bytes1 hi = bytes1(uint8(b) / 16);
        bytes1 lo = bytes1(uint8(b) - 16 * uint8(hi));
        s[2*i] = char(hi);
        s[2*i+1] = char(lo);            
    }
    return string(s);
  }

  function char(bytes1 b) internal pure returns (bytes1 c) {
      if (uint8(b) < 10) return bytes1(uint8(b) + 0x30);
      else return bytes1(uint8(b) + 0x57);
  }

}
